        { }

        [TestInitialize]
        public override void TestInitialize()
        {
            base.TestInitialize();
            MockSessionService.Setup(m => m.UserConfigurationId).Returns(Config.Defaults.ConfigurationVersions.InitialVersion.Id);
        }

        protected ITranslationService GetService()
        {
            var service = new TranslationService(
                MockHttpFactory.Object, 
                MemoryCache,
                MockSessionService.Object,
                MockServiceSettings.Object,
                _authSettings,
                MockAuthService.Object);

            return service;
        }
    }
